import { Navigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";


const PublicRoute = ({ children }) => {
    const { currentUser } = useAuth()
    if (currentUser) {
        return children
    }
    return <Navigate to='/' replace/>
}

export default PublicRoute;
